	/**
	 * 获取业务内容解析集合
	 * @param requestConfig
	 * @param userId
	 * @return
	 */
	public static List<Map<String, String>> achieveData(RequestConfig requestConfig, String userId,String sqxh,InvokeRecodeService invokeRecodeService){
		//获取服务
		MicroServiceHnPort microServiceHnPort = achieveService();
		//调用webservice接口
		TirIpPackage tirIpPackage = microServiceHnPort.Process(requestConfig);
		List<Map<String, String>> datalist = new ArrayList<Map<String, String>>();
		InvokeRecordEntity invokeRecordEntity = new InvokeRecordEntity();
		Gson gson = new Gson();
		//解析请求参数
		Map<String,String>parameter = gson.fromJson(requestConfig.getContent(), new TypeToken<Map<String, String>>() {}.getType());
		
		if("00000000".equals(tirIpPackage.getReturnState().getReturnCode())) {
			//解析业务内容
			//String v_content = businessContentService(requestConfig);
			//ResMsg resMsg = gson.fromJson(v_content, ResMsg.class);
			ResMsg resMsg = gson.fromJson(tirIpPackage.getBusinessContent().getSubPackage().getContent(), ResMsg.class);
			//将json串转成对象
			if(resMsg.getData() != null) {
				Map<String, String> dataMap = gson.fromJson(gson.toJson(resMsg.getData()), new TypeToken<Map<String, String>>() {}.getType());
				datalist.add(dataMap);
			} else if (resMsg.getDataList() != null) {
				datalist = gson.fromJson(gson.toJson(resMsg.getDataList()), new TypeToken<List<Map<String, String>>>() {}.getType());
				for(int i = 0; i < datalist.size(); i++){
					datalist.get(i).put("sssqq", parameter.get("ssqq"));
					datalist.get(i).put("sssqz", parameter.get("ssqz"));
				}
			} else if (resMsg.getData() == null && resMsg.getDataList() == null) {
				Map<String, String> dataMap = new HashMap<String, String>();
				dataMap.put("sssqq", resMsg.getSssqq());
				dataMap.put("sssqz", resMsg.getSssqz());
				datalist.add(dataMap);
			}
			for(int i = 0; i < datalist.size(); i++){
				//用户userId用于每张表的creatorid字段
				datalist.get(i).put("userId", userId);
				//登记序号
				datalist.get(i).put("djxh", parameter.get("nsrdzdah"));
				//授权编码
				datalist.get(i).put("lpbm", parameter.get("lpbm"));
				//给每张表一个申请序号
				datalist.get(i).put("sqxh", sqxh);
			}
		} else {
			invokeRecordEntity.setCreateTime(new Date());
			invokeRecordEntity.setInterfaceReturnInfo(tirIpPackage.getReturnState().getReturnMessage());
			invokeRecordEntity.setInvokeId(sqxh);
			invokeRecordEntity.setServiceId(requestConfig.getServiceId());
			invokeRecordEntity.setUserId(userId);
			invokeRecordEntity.setInvokeTimes(0);
			
			invokeRecordEntity.setLpbm(parameter.get("lpbm"));
			invokeRecordEntity.setYxqq(parameter.get("ssqq"));
			invokeRecordEntity.setYxqz(parameter.get("ssqz"));
			invokeRecodeService.insertRecode(invokeRecordEntity);
			System.out.println(tirIpPackage.getReturnState().getReturnMessage());
		}
		return datalist;
	}
	
	
	/**
	 * 获取接口服务
	 * @return
	 */
	public static MicroServiceHnPort achieveService(){
		// TODO Auto-generated method stub
		JaxWsProxyFactoryBean factory = new JaxWsProxyFactoryBean();
        // 注册WebService接口
        factory.setServiceClass(MicroServiceHnPort.class);
        // 设置WebService地址
        factory.setAddress("http://120.77.177.50:9999/microsilver/services/microservice");//59.110.65.173
        MicroServiceHnPort microServiceHnPort = (MicroServiceHnPort) factory.create();
        return microServiceHnPort;
	}
	
	
